    @Test
    public void testDeviceRetriveal() {
        for (long id : FullDataset.keySet()) {
            assertEquals("Validating device id " + id, DeviceDataset.get(id), FullDataset.get(id));
        }
    }

    @Test
    public void testInvalidDevices() {
        assertNull(DeviceDataset.get(0));
        assertNull(DeviceDataset.get(-1));
        assertNotNull(DeviceDataset.get(10000));
    }

    public void assertEquals(String msg, DeviceDataset.Device d, DeviceDataset.Device d2) {
        Assert.assertEquals(msg, d.id, d2.id);
        Assert.assertEquals(msg, d.what, d2.what);
        //Assert.assertEquals(msg, d.model, d2.model);
        Assert.assertEquals(msg, d.where, d2.where);
        Assert.assertEquals(msg, d.tubeLength, d2.tubeLength, 0.0001);
        Assert.assertEquals(msg, d.lensFocalLength, d2.lensFocalLength, 0.0001);
        Assert.assertEquals(msg, d.lensEyeDistance, d2.lensEyeDistance, 0.0001);
        Assert.assertEquals(msg, d.angularSteps, d2.angularSteps, 0.0001);
        Assert.assertEquals(msg, d.defaultPD, d2.defaultPD, 0.0001);
        Assert.assertEquals(msg, d.defaultStartingPower, d2.defaultStartingPower, 0.0001);
        Assert.assertEquals(msg, d.viewToRun, d2.viewToRun);
        Assert.assertEquals(msg, d.phoneOrientation, d2.phoneOrientation);
        Assert.assertEquals(msg, d.pdTechnique, d2.pdTechnique);
        Assert.assertEquals(msg, d.pdRulerCenter, d2.pdRulerCenter);
        Assert.assertEquals(msg, d.movingAngles, d2.movingAngles);
        Assert.assertEquals(msg, d.clearScreenBetweenAngles, d2.clearScreenBetweenAngles);
        Assert.assertEquals(msg, d.slitDistance, d2.slitDistance, 0.0001);
        Assert.assertEquals(msg, d.deviceType, d2.deviceType);
        Assert.assertEquals(msg, d.accuracyTechnique, d2.accuracyTechnique);
        Assert.assertEquals(msg, d.eyesAtATimeTechnique, d2.eyesAtATimeTechnique);
        Assert.assertEquals(msg, d.rotationalInteraction, d2.rotationalInteraction);
        Assert.assertEquals(msg, d.meridianRadius, d2.meridianRadius, 0.0001);
        Assert.assertEquals(msg, d.deltaMeridianFromCalibration, d2.deltaMeridianFromCalibration);
        Assert.assertEquals(msg, d.meridianThickness, d2.meridianThickness, 0.0001);
        Assert.assertEquals(msg, d.scrollyRadius, d2.scrollyRadius, 0.0001);
        Assert.assertEquals(msg, d.deltaScrollyFromCalibration, d2.deltaScrollyFromCalibration);
        Assert.assertEquals(msg, d.scrollyThickness, d2.scrollyThickness, 0.0001);
        Assert.assertEquals(msg, d.deltaPDRectTopLeftFromCalibration, d2.deltaPDRectTopLeftFromCalibration);
        Assert.assertEquals(msg, d.deltaPDRectBottomRigthFromCalibration, d2.deltaPDRectBottomRigthFromCalibration);
        Assert.assertEquals(msg, d.calibrationRectTopLeft, d2.calibrationRectTopLeft);
        Assert.assertEquals(msg, d.calibrationRectBottomRight, d2.calibrationRectBottomRight);
        Assert.assertEquals(msg, d.intensityThreshold, d2.intensityThreshold);
        Assert.assertEquals(msg, d.distanceBetweenCalibrationMarks, d2.distanceBetweenCalibrationMarks, 0.0001);
        Assert.assertEquals(msg, d.lowestPower, d2.lowestPower, 0.0001);
        Assert.assertEquals(msg, d.highestPower, d2.highestPower, 0.0001);
        Assert.assertEquals(msg, d.calibrationType, d2.calibrationType);
        Assert.assertEquals(msg, d.sliderCenterPerspectiveOffset, d2.sliderCenterPerspectiveOffset, 0.0001);
        Assert.assertEquals(msg, d.previewFrameSize, d2.previewFrameSize);
        Assert.assertEquals(msg, d.slitsLinesAlignmentDelta, d2.slitsLinesAlignmentDelta, 0.0001);
    }
